            if (item.Name is {} Nameitem)
            {
                hash.Add(HashCode.Combine(Nameitem.Male, Nameitem.Female));
            }
            if (item.Insignia is {} Insigniaitem)
            {
                hash.Add(Insigniaitem);
            }
            return hash.ToHashCode();
        }
        
